def uniquePathsWithObstacles(obstacleGrid):
    r,c = len(obstacleGrid),len(obstacleGrid[0])
    if obstacleGrid[0][0]==1:
        return 0
    pr,pc = [1,0],[0,1]
    stack = [(0,0)]
    count = 0
    obstacleGrid[r-1][c-1] = -1 if obstacleGrid[r-1][c-1] != 1 else 1
    while len(stack)!=0:
        curr = stack.pop()
        if obstacleGrid[curr[0]][curr[1]] == -1:
            count +=1 
        for tmpr,tmpc in zip(pr,pc):
            dyr = tmpr + curr[0]
            dyc = tmpc + curr[1]
            if 0<=dyr<r and 0<=dyc<c and obstacleGrid[dyr][dyc] != 1:
                stack.append((dyr,dyc))
    return count 
